import React from 'react';
import styled from 'styled-components';

const StyledSlideFour = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;

  .left-column {
    background: #FAC943;
    height: 95vh;
    width: 35vw;
    position: absolute;
    bottom: 0;
    left: 75px;
  }
`;

function SlideFour() {
  return (
    <StyledSlideFour className="slide-four">
      <div className='left-column'>

      </div>
    </StyledSlideFour>
  );
}

export default SlideFour;
